import React from "react"
import "./App.css"
class App extends React.Component{
    render(){
        return(
            <div>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Services</li>
                    <li>Contact</li>
                </ul>

            </div>
        )
    }
}


export default App;
